import "./App.css";

function App() {
  //const names = ["Aram", "Ali", "Gity", "baba", "maman", "Elina", "Emad"];
  const users = [
    { name: "Ali", age: 44, email: "kardsfsdfdsami@kjh.com" },
    { name: "Awerewli", age: 33, email: "kadfsdrami@kjh.com" },
    { name: "Aldsfsdfi", age: 55, email: "kasdfsdsfddsfsdrami@kjh.com" },
  ];
  return (
    <div className="App">
      {users.map((user, index) => {
        <div>
          <h2 key={index}>{user.name}</h2>
          <h2 key={index}>{user.age}</h2>
          <h2 key={index}>{user.age}</h2>
        </div>;
      })}
    </div>
  );
}

export default App;
